        method:"POST",
        headers:{
            "content-type":"application/json; charset=utf-8",
            "Authorization":"Bearer " + token
            }
        })
    const profileData = await profileResponse.json()
    const userData = profileData
    console.log(userData)
    return userData
}

export default useToken
